    // Leet code problem 283: Move zeros
    // Problem statement: Given an integer array nums, move all 0's to the end of it while maintaining the relative order of the non-zero elements.
    // Do an inplace replacement
    
    /* Logic 1 : Keep a counter variable to track the position and number of non zeros elements in the array.
     Start the counter at zero.
     Traverse through the array and if you encounter non zero elements move  it to the position denoted by counter and then increment the counter
     after the for loop if counter < nums.length, replace the all elements beyond counter to 0
     */
    public static void moveZeroes(int[] nums) {
        int counter = 0;
        for (int i = 0; i<nums.length; i++){
            //if nums[i] != 0, replace nums[counter] = nums[i], increment counter++
            if( nums[i] != 0){
                nums[counter++] = nums[i];
            }
        }

        //#if counter <nums.length, replace all counter++ elements to 0
        while(counter < nums.length){
            nums[counter++] = 0;
        }
    }

    /* Logic 2 :  */
    public static void moveZeroesMethod2(int[] nums) {
        int l = 0;
        for(int r = 0; r< nums.length; r++){
             //if nums[r] != 0, swap (nums[l] ,nums[r]), increment l++
            if(nums[r] != 0){
                int temp = nums[l];
                nums[l] = nums[r];
                nums[r] = temp;
                l+=1;
            }
        }
    }
    
