    //Leetcode 217: Contains Duplicate
    //Problem Statement: Given an integer array nums, return true if any value appears at least twice in the array, and return false if every element is distinct.

    /* Logic 1: Using Brute Force. Compare each of the n elements with other n-1 elements. Time complexity is O(n^2), space complexity is O(1).
    Logic 2: Sort the array and then compare the adjacent elements to see if they are the same. Time complexity is O(nlogn) and space complexity is O(1).
    Logic 3: Using Hashmap. Since a HashMap can contain only unique elements. First create a hashmap and add the elements from the given array if it's not alreay present in the array. 
    If the array is already present then return True
     */

    public static boolean containsDuplicate(int[] nums) {
    //Using Logic 3 for this implementation

    //Step 1: create a empty HashMap
    HashMap<Integer, Integer> unique_set = new HashMap<Integer, Integer>();

    //Step2: Loop through the given array and add only those elements that are not present in the hashmap already
    //If already present return ture

    for(int i = 0; i<nums.length;i++){
        if(unique_set.containsKey(nums[i])){
            return true;
        }
        else{
            unique_set.put(nums[i], i);
        }
    }
    return false;
    }

    //Leetcode 242: Valid Anagram
    // Problem statement: Given two strings s and t, return true if t is an anagram of s, and false otherwise. An Anagram is a word or phrase formed by rearranging the letters of a different word or phrase, typically using all the original letters exactly once.
   /* Logic */
   public static boolean isAnagram(String s, String t) {
    
    //First check if the lengths of string s and t are the same or not. If they are not the same return False since anagram should be of same length
    if(s.length() != t.length()){
        return false;
    }

    //Since the length of s and t are the same if they are indeed anagrams lets build the hashmap of s and t in one loop
    //First create an empty hashmap of s and t
    HashMap<Character, Integer> hashmap_of_S = new HashMap<Character, Integer>();
    HashMap<Character, Integer> hashmap_of_t = new HashMap<Character, Integer>();

    //Loop through length of s and populate the hashmap of s and t with their characters as key and frequency of those characters as value
    //Use charAt(index) to access the element at position i in the string
    // Use getOrDefault() method of HashMap class to get the value associated with a key. Can also enter a default value if the hashmap contains no mapping for that key.
    for(int i =0; i<s.length(); i++){
        hashmap_of_S.put(s.charAt(i), hashmap_of_S.getOrDefault(s.charAt(i), 0)+1);
        hashmap_of_t.put(t.charAt(i), hashmap_of_t.getOrDefault(t.charAt(i), 0)+1);
    }

    //System.out.println("hashmap of s is"+ hashmap_of_S);
    //System.out.println("hashmap of t is"+ hashmap_of_t);

    //Get the characters from hashmap_of_s and compare it to the characters in hashmap_of_t. If they are not the same then returen false
    for(Character key : hashmap_of_S.keySet()){
        // If characters of t and s are not same, then return false
        if(!hashmap_of_t.containsKey(key)){return false;}
        //If characters in both strings are same but the frequencies are not the same then return false
        // Remember: == compares the location of the of objects in memory whereas .equals() compared the contents of the object in memory.
        if(hashmap_of_t.containsKey(key) && (!hashmap_of_t.get(key).equals(hashmap_of_S.get(key)))){
            return false;
        }
    }
    // If it fully completes the for loop then return true, it an anagram
    return true;

   }


   //Leetcode 1: Two Sum
   //Problem Statement: Given an array of integers nums and an integer target, return indices of the two numbers such that they add up to target.You may assume that each input would have exactly one solution, and you may not use the same element twice.You can return the answer in any order.

   /* Logic 1: Brute force: Loop through each n element in the array and then calculate its sum with other n-1 elements. any pairwise sum matches the target return the indices. Time complexity is O(n^2)
    Logid 2: Using hashmap. Time complexity is O(n). Space complexity is O(n). Create a hashmap of value and its position(index). 
    Run a loop through the index of the array
    Step 1: check if the target - nums[index] is present in the hashmap already. If it is present then return the index of both elements as output
    Step2: Else: add that diff to the hashmap and continue the loop
    */
   public static int[] twoSum(int[] nums, int target) {

    //Creating a hashmap to store the value and its index
    HashMap<Integer, Integer> value_pos_hm = new HashMap<Integer, Integer>();

    //int[] output =null;
    //Run loop through all elements of the array
    for(int i =0; i<nums.length; i++){
        //Find the difference between the target and nums[i]
        int diff = target-nums[i];
        //Check if this diff is present in the hashmap
        if(value_pos_hm.containsKey(diff)){
            // If the diff is present in the hashmap return the diff and nums[i] index
            int[] output = {value_pos_hm.get(diff), i};
            return output;
        }
        else{
            //else add the nums[i] into the hashmap
            value_pos_hm.put(nums[i], i);
        }
    }
    return null;

   }
